import React from "react";

const Experience = () => {
  return (
    <div className="experience">
      <div className="achievement">
        <div className="circle">8+</div>
        <span>years </span>
        <span>Experience</span>
      </div>

      <div className="achievement">
        <div className="circle">20+</div>
        <span> </span>
        <span>Experience</span>
      </div>

      <div className="achievement">
        <div className="circle">8+</div>
        <span>years </span>
        <span>Experience</span>
      </div>

    </div>
  );
};
export default Experience
